jQuery(document).ready(function($) {
    // Scroll to section init
    $("a[rel='2id']").mPageScroll2id();

    // Logos slider
    $('.logos-slider').slick({
        infinite: true,
        slidesToShow: 5,
        slidesToScroll: 1,
        autoplay: true,
        arrows: true,
        autoplaySpeed: 2000,
        prevArrow: '.logos-prev',
        nextArrow: '.logos-next'  
    });    
    //Review slider
    $('.past-review').slick({
        infinite: true,
        slidesToShow: 1,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed: 1000,
        prevArrow: '.com-prev',
        nextArrow: '.com-next',
        dots: true,
        customPaging: function(slider, i) {
            for (var n = 0; n < 3; n++) {
                return ' <a href="#" class="dot">' + $(slider.$slides[i]).find('.slide-title').text() + '</a>';
            }
        }
    });

    //Gallery init 
    $('.past-gallery').magnificPopup({
        delegate: 'a',
        type: 'image',
        tLoading: 'Загрузка #%curr%...',
        mainClass: 'mfp-img-mobile',
        gallery: {
            enabled: true,
            navigateByImgClick: true,
            preload: [0, 1] // Will preload 0 - before current, and 1 after the current image
        },
        image: {
            tError: '<a href="%url%">Изображение #%curr%</a> не может быть загружено.',
        }
    });

    //Loading form
    $('.open-form').magnificPopup({
        type: 'inline',
        preloader: false,
        focus: '#name',
    });
    var magnificPopup = $.magnificPopup.instance;

    //Send forms data
    function sendForm(input_form) {
        var form = $(input_form);
        var error = false;
        form.find('.required').each(function() {
            if (validate(this)) {
                error = true;
            }
        });
        //Send data
        if (!error) {
            var str = form.serialize();
            console.log(str);
            console.log(form);
            $.ajax({
                type: 'POST',
                url: 'send.php',
                data: str,
                success: function() {

                    form.find('.required').each(function() {
                        $(this).val('');
                    })
                    $('.ajax-loader').hide();
                    $.magnificPopup.open({
                        items: {
                            src: '#form-ok',
                            type: 'inline',
                            closeBtnInside: true,
                            showCloseBtn: true
                        }
                    });

                    setTimeout(function() {
                        magnificPopup.close();
                    }, 3000);
                    $('.form-error').html('');
                },
                beforeSend: function(){
                    $('.ajax-loader').show();
                }
            })
        }
    }

    //Validation
    function validate(obj) {
        var error = false;
        parent = $(obj).parent();
        if (!noEmpty($(obj))) {
            $(obj).addClass('error');
            if (!error) {
                error = true;
                parent.children('.form-error').html('Одно из полей не заполнено');
                throw new Error("Something went badly wrong!");
            }
        } else {
            $(obj).removeClass('error');
            error = false;
            $('.form-error').html('');
        }

        if ($(obj).attr('type') == 'email' && !isEmail($(obj))) {
            $(obj).addClass('error');
            if (!error) {
                error = true;
                parent.children('.form-error').html('Проверьте правильность введённых данных');
                throw new Error("Something went badly wrong!");
            }
        } else if ($(obj).attr('type') == 'email') {
            $(obj).removeClass('error');
            error = false;
            parent.children('.form-error').html('');
        }

        if ($(obj).attr('name') == 'phone' && !isPhone($(obj))) {
            $(obj).addClass('error');
            if (!error) {
                error = true;
                parent.children('.form-error').html('Неверный телефон');
                throw new Error("Something went badly wrong!");
            }
        } else if ($(obj).attr('type') == 'phone') {
            $(obj).removeClass('error');
            error = false;
            $('.form-error').html('');
        }
        return error;
    }


    //Is on mo empty value testing
    function noEmpty(element) {
        if ($(element).val() == '') {
            return false;
        } else {
            return true;
        }
    }

    //Is email testing
    function isEmail(element) {
        var email = /^[-\w.]+@([A-z0-9][-A-z0-9]+\.)+[A-z]{2,4}$/;
        return email.test($(element).val());
    }

    //Is text field numbers and charts in latin and cyrilic
    function isText(element) {
        var text = /^[а-яА-ЯёЁa-zA-Z0-9]+$/;
        return text.test($(element).val());
    }

    //Is numbers for phone field
    function isPhone(element) {
        var text = /([0-9]+)/;
        return text.test($(element).val());
    }

    $('.form-btn').click(function() {
        sendForm('#reg-form');
    })
    $('.send-pr').click(function() {
        sendForm('#regwi-form');
    })

    $('input').on('change', function() {
        validate(this);
    })

});
